public class WildcardMatching {
	public static void main(String args[]) {
		String s = ""; 
		String p = "**";
		String s1 = "aa";
		String p1 = "aa";
		boolean result = new WildcardMatching().isMatch(s1, p1);
		System.out.println(result);
		
	}
	
	public boolean isMatch(String s, String p) {
		if (s == null || p == null) return false;
		
		int i = 0;
		int j = 0;
		int j_pos = -1;
		int i_pos = -1;
		while (i < s.length()) {
			if (j != p.length()) {
				if (p.charAt(j) == '*') {
					j_pos = j;
					i_pos = i;
					j++;
					continue;
				}
				if (p.charAt(j) == '?' || p.charAt(j) == s.charAt(i)) {
					i++;
					j++;
					continue;
				}
			}
			if (j_pos == -1) return false;
			
			j = j_pos + 1;
			i = i_pos + 1;
			i_pos++;
		}
		
		while (j < p.length() && p.charAt(j) == '*')
			j++;
		return j == p.length();
	}
	
	public boolean isMatch2(String s, String p) {
		if (s == null || p == null) return false;
		
		boolean[] match = new boolean[s.length() + 1];
		match[0] = true;
		int prevlowest = 0;
		for (int i = 0; i < p.length(); i++) {
			int lowest = s.length() + 1;
			if (p.charAt(i) == '*') {
				boolean tmp = false;
				for (int j = prevlowest; j <= s.length(); j++) {
					tmp |= match[j];
					match[j] = tmp;
				}
			}
			else {
				for (int j = s.length(); j > prevlowest; j--) {
					if (p.charAt(i) == '?')
						match[j] = match[j-1];
					else
						match[j] = match[j-1] && (p.charAt(i) == s.charAt(j-1));
					
					if (match[j])
						lowest = j;
				}
				match[prevlowest] = false;
				prevlowest = lowest;
				if (prevlowest > s.length())
					return false;
			}
		}
		return match[s.length()];
	}
}